import React from 'react';
import Tour from './Tour';
import styles from './Tour.module.css';
const Tours = () => {
  return (
    <section>
      <div className={styles.title}>
        <h2>our tours</h2>
      </div>
      <div>
        {tours.map((ele) => {
          <div className={styles.d}>
            <img src={ele.image} />
            <p> {ele.title}</p>
          </div>;
        })}
      </div>
    </section>
  );
};

export default Tours;
